import React from 'react';
import MoobeHeader from 'components/common/layout/Header';
import MoobeBody from "components/common/layout/Body";

class App extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <section className="hero">
                <MoobeHeader />
                <MoobeBody />
            </section>
        );
    }

}

export default App;
